const todos = [
  { text: 'Cortar cebolla', completed: false},
  { text: 'Tomar curso de Reac', completed: false},
  { text: 'Llorar con la llorona', completed: false},
]

function App() {
  return (
    <div>
      <TodoCounter />
        <h2>Has completado 2 de 3 TODOS</h2>

      <TodoSearch />
        <input placeholder="Cebolla" />

      <TodoList>
        {todos.map(todo => (
          <TodoItem />
        ))}
      </TodoList>

      <CreateTodoButton />
      <button>+</button>
    </div>
  );
}

export default App;
